import React, { Fragment, Component } from "react";
import Navbar from "./components/layout/Navbar";
import "./App.css";

class App extends Component {
  render() {
    return (
      <nav className="navbar bg-primary">
        <Navbar />
      </nav>
    );
  }
}
export default App;
